import React, { Fragment } from "react";
import styled from "styled-components";

const Wrapper = styled.section`
	display: flex;
	flex-direction: column;
	justify-content: center;
	align-items: center;
	text-align: center;
	font-family: "Quicksand";
`;

const WrapperMenu = styled.div`
	margin-top: 25px;
	display: flex;
	flex-direction: column;
	justify-content: center;
	align-items: center;
	text-align: center;
`;

const Menu = styled.p`
	text-align: center;
	color: black;
	font-size: 50px;
	font-family: "Quicksand";
`;

const LogoImage = styled.img`
	display: flex;
	justify-content: space-around;
	width: 100vw;
`;

const LogoName = styled.img`
	display: flex;
	flex-direction: column;
	justify-content: center;
	align-items: center;
	text-align: center;
	font-family: "Quicksand";
`;
const image = "../images/logo.png";
const name = "../images/giftu.png";

const Home = () => {
	return (
		<Fragment>
			<Wrapper>
				<LogoName />
				<WrapperMenu>
					<Menu>MENU</Menu>
					<LogoImage />
				</WrapperMenu>
			</Wrapper>
		</Fragment>
	);
};

export default Home;
